import React, { useEffect } from 'react';
//import CreateForm from '../components/ExerciseCreateForm';
//import Exercises from '../components/Exercises';
//import UpdateForm from '../components/ExerciseUpdateForm.js';
import exercisesStore from '../stores/exercisesStore';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import MyNavbar from '../components/MyNavbar';
import ExercisesTable from '../components/ExercisesTable'
import { useParams } from 'react-router-dom';

export default function ExercisesPage() {
    const store = exercisesStore();

    const _id = useParams();


    useEffect(() => {
        store.fetchExercises(_id);
    }, [])

    return(
        <Container>
            <Row>
                <Col><MyNavbar /></Col>
            </Row>
            <Row className="body">
                <Col>
                    <h1>Exercises</h1>
                    <ExercisesTable workout_id={_id} />
                </Col>
                <Col>
                {/*<UpdateForm />
                    */}

                </Col>
            </Row>
        </Container>
    );
}
